import React, { useState, useRef } from 'react';
import { usePapaParse } from 'react-papaparse';
import './App.css';
import { CSVLink } from 'react-csv';
import { Pie } from 'react-chartjs-2';
import { Chart as ChartJS, ArcElement, Tooltip, Legend, CategoryScale, LinearScale } from 'chart.js';

ChartJS.register(ArcElement, Tooltip, Legend, CategoryScale, LinearScale);

function App() {
  const { readString } = usePapaParse();
  const [csvData, setCsvData] = useState(null);
  const [results, setResults] = useState([]);
  const [progress, setProgress] = useState(0);
  const [showProgress, setShowProgress] = useState(false);
  const [showCharts, setShowCharts] = useState(false);
  const [validationMessage, setValidationMessage] = useState('');
  const fileInputRef = useRef(null);

  const handleFileDrop = (e) => {
    e.preventDefault();
    const file = e.dataTransfer.files[0];
    handleFileUpload(file);
  };

  const handleFileClick = () => {
    fileInputRef.current.click();
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    handleFileUpload(file);
  };

  const handleFileUpload = (file) => {
    if (file && file.type === 'text/csv') {
      const reader = new FileReader();
      reader.onload = (event) => {
        readString(event.target.result, {
          header: true,
          complete: (result) => {
            const validData = result.data.filter((row) => {
              try {
                const keys = Object.keys(row);
                return keys.length >= 2 && keys[0] && keys[1];
              } catch (error) {
                return false;
              }
            });

            if (validData.length === 0) {
              alert('No valid data in CSV file');
              return;
            }

            const formattedData = validData.map((row) => {
              const keys = Object.keys(row);
              return {
                [keys[0]]: row[keys[0]],
                [keys[1]]: row[keys[1]],
              };
            });

            setCsvData(formattedData);
            setShowProgress(false);
            setShowCharts(false);
            setValidationMessage('CSV file uploaded and validated successfully.');
          },
        });
      };
      reader.readAsText(file);
    } else {
      alert('Please upload a valid CSV file.');
    }
  };

  const handleProcess = () => {
    if (!csvData) return;
    console.log(csvData);
    // // Send data to API
    // fetch('https://dummyapi.com/endpoint', {
    //   method: 'POST',
    //   headers: {
    //     'Content-Type': 'application/json',
    //   },
    //   body: JSON.stringify(csvData),
    // });
    performRequests(csvData);
  };

  const performRequests = async (data) => {
    const totalRequests = data.length;
    let completedRequests = 0;
    const results = [];

    await Promise.all(
      data.map(async (row) => {
        const startTime = performance.now();
        try {
          const response = await fetch(row.URL, { method: 'HEAD' });
          const endTime = performance.now();
          results.push({
            id: row.id,
            URL: row.URL,
            responseCode: response.status,
            responseTime: (endTime - startTime).toFixed(2),
            fullResponse: JSON.stringify(response.headers),
          });
        } catch (error) {
          results.push({
            id: row.id,
            URL: row.URL,
            responseCode: 'Error',
            responseTime: 'N/A',
            fullResponse: error.message,
          });
        }
        completedRequests++;
        setProgress((completedRequests / totalRequests) * 100);
      })
    );

    setResults(results);

  };

  const responseCodeCounts = results.reduce((acc, result) => {
    acc[result.responseCode] = (acc[result.responseCode] || 0) + 1;
    return acc;
  }, {});

  const chartData = {
    labels: Object.keys(responseCodeCounts),
    datasets: [
      {
        label: '# of Responses',
        data: Object.values(responseCodeCounts),
        backgroundColor: [
          'rgba(75, 192, 192, 0.2)',
          'rgba(255, 99, 132, 0.2)',
          'rgba(54, 162, 235, 0.2)',
          'rgba(255, 206, 86, 0.2)',
          'rgba(75, 192, 192, 0.2)',
        ],
        borderColor: [
          'rgba(75, 192, 192, 1)',
          'rgba(255, 99, 132, 1)',
          'rgba(54, 162, 235, 1)',
          'rgba(255, 206, 86, 1)',
          'rgba(75, 192, 192, 1)',
        ],
        borderWidth: 1,
      },
    ],
  };

  return (
    <div className="App">
      <header className="App-header">
        <div
          className="file-drop"
          onDrop={handleFileDrop}
          onDragOver={(e) => e.preventDefault()}
          onClick={handleFileClick}
        >
          <p>Drag and drop a CSV file here or click to upload</p>
          <input
            type="file"
            accept=".csv"
            onChange={handleFileChange}
            ref={fileInputRef}
            style={{ display: 'none' }}
          />
        </div>
        {validationMessage && <p className="validation-message">{validationMessage}</p>}
        {showProgress && (
          <div className="progress-bar">
            <div className="progress" style={{ width: `${progress}%` }}></div>
          </div>
        )}
        <button onClick={handleProcess} className="process-button">
          Process
        </button>
        {showCharts && (
          <div className="charts">
            <Pie
              data={chartData}
              options={{ responsive: true, maintainAspectRatio: false }}
              width={400}
              height={400}
            />
          </div>
        )}
        {results.length > 0 && showCharts && (
          <CSVLink data={results} filename="results.csv" className="App-link">
            Download Results
          </CSVLink>
        )}
      </header>
    </div>
  );
}

export default App;
